  false,\n\t\"url\": null,\n\t\"notes\": \"Dataset provides information on out-of-state
  travel including amount reimbursed, source of funds, time frame for traveling, purpose
  for traveling, and destination starting July 1, 2011 through current fiscal year,
  year to date. The state fiscal year runs from July 1 to the following June 30 and
  is numbered for the calendar year in which it ends. The State of Iowa operates on
  a modified accrual basis which provides that encumbrances on June 30 must be paid
  within 60 days after year end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
